const Location = () => {
  var Flickr = require('flickr-sdk');
  var FLICKR_API_KEY = '248220c73c6bb9b90f93c50e077719cf'
  var location = new Flickr(FLICKR_API_KEY);
  const geoinfo = [
    location.photos.geo.getLocation({
      photo_id: 40848445013
    })
  ]

  return(
  <>
  {geoinfo.map((info) => (
        <h3>{geoinfo.location}</h3>
        ))}
  </>

  );
}

export default Location
